import { FETCH_NOTES, ADD_NOTE } from './types';

export function fetchNotes() {
  return function (dispatch) {
    axios
      .get('/api/notes')
      .then((res) => res.json())
      .then((notes) =>
        dispatch({
          type: FETCH_NOTES,
          payload: notes,
        })
      );
  };
}
